(window.webpackJsonp=window.webpackJsonp||[]).push([[47],{370:function(e,t,a){"use strict";a.r(t);var n=a(0),i=function(e){var t,n,i,s,p,o,c,g,A,r,d,l,u,w,h=(t=void 0,n="post",i="数码",s={},p=new Date(1568651380562),o={},c="markdown",g="配件展示",A="装机部分",r="测试部分",d="温度与稳定性",l="性能与超频调整",u="其它测试",w={},s.internal=t,s.contentType="default",s.isCategoryPage=!0,s.layout="category",s.permalink="/blog/category/digital",s.slug="digital",s.createdAt=p,s.updatedAt=p,s.posts=[o,w],s.pagination={hasPrev:!1,hasNext:!1,total:1,current:1,prevLink:"/blog/category/digital/page/2",nextLink:t},s.category=i,s.assets={},s.attributes=s,s.content=t,o.internal=t,o.contentType=c,o.slug="amd-itx-diy-specs-for-the-next-5-years",o.content=t,o.layout=n,o.title="致五年 E3 青春：AMD YES! ITX 装机作业",o.keywords="specs,amd yes,u1 plus,itx,装机作业,小钢炮,diy,装机配置,配置单",o.description="哈哈哈，这次文章的标题有点假文艺。不过确实说的也是事实，在完成了这次整个平台的装 机升级后，陪伴了我 5 年多的至强 E3-1230 v2 就被替下了，为性价比正式从牙膏厂跳到 了按摩店。大学那年第一次 DIY 装机就选择了当时所谓的“一代神 U”、“卡吧标配”的 E3v2， 从此开启了我的 DIY 装机“职业生涯” 。",o.date="2019-07-07 01:00:00",o.updated="2019-07-08 09:31:05",o.assets={cover:a(73)},o.categories=[i],o.markdownHeadings=[{text:g,slug:g,level:2},{text:A,slug:A,level:2},{text:r,slug:r,level:2},{text:d,slug:d,level:3},{text:l,slug:l,level:3},{text:u,slug:u,level:3}],o.excerpt='<figure data-type="image"><saber-image src="../_assets/uploads/2019/07/20190705001.jpg" alt="头图：U1-PLUS 与 MacBook Pro 13\'"></saber-image><figcaption>头图：U1-PLUS 与 MacBook Pro 13\'</figcaption></figure>\n<p>哈哈哈，这次文章的标题有点假文艺。不过确实说的也是事实，在完成了这次整个平台的装机升级后，陪伴了我 5 年多的至强 E3-1230 v2 就被替下了，为性价比正式从牙膏厂跳到了按摩店。大学那年第一次 DIY 装机就选择了当时所谓的“一代神 U”、“卡吧标配”的 E3v2，从此开启了我的 DIY 装机“职业生涯” —— 哈哈说笑，也就可算是懂得了倒腾配置装机云云。</p>\n',o.createdAt=new Date(15624324e5),o.updatedAt=new Date(1562549465e3),o.type=n,o.permalink="/blog/2019/07/amd-itx-diy-specs-for-the-next-5-years",o.attributes=o,w.internal=t,w.contentType=c,w.slug="nintendo-switch-unboxing-and-simple-review",w.content=t,w.layout=n,w.title="Nintendo Switch 开箱与简评",w.date="2017-12-15 22:28:04",w.updated="2017-12-16 18:04:00",w.keywords="Nintendo Switch,任天堂 Switch,Switch 港版,NS 开箱,马里奥奥德赛",w.description="在双十二这天，我咬咬牙买下了任天堂 Switch 和马里奥奥德赛。在进行 NS 开箱后写下这边文章作为记录， 记录一下 Switch 港版开箱含哪些配件等信息，简述一下 Switch 到底值不值得买。",w.assets={cover:a(64)},w.categories=[i],w.markdownHeadings=[{text:"开箱",slug:"开箱",level:2}],w.excerpt="<p>恭喜任家的 Switch 销量突破千万！在任天堂宣布 Switch 历时九个月全球销量突破 1000 万的双十二当天，我咬咬牙，也成了千万分之一员。友人说我充值了信仰，其实我大概也不是 Nintendo 的热衷粉丝，不然估计早早就收入囊中。只是今年 NS 确实是够火热，这不其独占的《塞尔达传说：荒野之息》才拿下了 TGA 年度最佳游戏。</p>\n",w.createdAt=new Date(1513348084e3),w.updatedAt=new Date(151341864e4),w.type=n,w.permalink="/blog/2017/12/nintendo-switch-unboxing-and-simple-review",w.attributes=w,s),m=e.options.beforeCreate||[];e.options.beforeCreate=[function(){this.$page=h}].concat(m);["layout","transition"].forEach(function(t){var a=e.options.PageComponent;a&&(e.options[t]=a[t]),void 0===e.options[t]&&(e.options[t]=h[t])}),e.options.name="page-wrapper-"+h.slug.replace(/[^0-9a-z\-]/i,"-")},s=Object(n.a)({},function(){var e=this.$createElement;return(this._self._c||e)("layout-manager")},[],!1,null,null,null);"function"==typeof i&&i(s);t.default=s.exports},64:function(e,t,a){e.exports={srcSet:a.p+"images/20181225007-d30c95e4.png 600w,"+a.p+"images/20181225007-db2a2e2b.png 480w",images:[{path:a.p+"images/20181225007-d30c95e4.png",width:600,height:450},{path:a.p+"images/20181225007-db2a2e2b.png",width:480,height:360}],src:a.p+"images/20181225007-d30c95e4.png",toString:function(){return a.p+"images/20181225007-d30c95e4.png"},placeholder:"data:image/png;base64,",width:600,height:450}},73:function(e,t,a){e.exports={srcSet:a.p+"images/20190705000-9d9d7493.png 600w,"+a.p+"images/20190705000-83c0a46a.png 480w",images:[{path:a.p+"images/20190705000-9d9d7493.png",width:600,height:450},{path:a.p+"images/20190705000-83c0a46a.png",width:480,height:360}],src:a.p+"images/20190705000-9d9d7493.png",toString:function(){return a.p+"images/20190705000-9d9d7493.png"},placeholder:"data:image/png;base64,",width:600,height:450}}}]);